    name = setName;
    tree = setTree;
    acorns = setAcorns;
  }

  @Override
  public boolean equals(Object o) {
    if (!(o instanceof Squirrel other)) {
      return false;
    }
    return name.equals(other.name) && tree.equals(other.tree);
  }

